import { useState } from "react";

const Home = () => {
   const [name, setName] = useState("Mario");
   const [age, setAge] = useState(25);

    const handleClick = () => {
        setName("Debs");
    }

    return ( 
        <div className="home">
            <h2>Home Page</h2>
            <p>{ name }</p>
            <button onClick={handleClick}>Click Me</button>
        </div>
     );
}

export default Home;
